function Play-Sound {
    param(
        [string]$path
    )
    $player = New-Object System.Media.SoundPlayer $path
    $player.Load()
    $player.PlaySync()
}

# Initialize last sound played timestamp
#$lastSoundPlayed = [datetime]::MinValue
#$soundCooldown = New-TimeSpan -Seconds 10

# Base64-encoded WAV data for the notification sound
$base64WAV = '
'
$bytes = [Convert]::FromBase64String($base64WAV)
$soundPath = [System.IO.Path]::GetTempFileName() + ".wav"
try {
    [System.IO.File]::WriteAllBytes($soundPath, $bytes)
} catch {
    Write-Error "Failed to write sound file: $_"
    exit
}

# Specify the path to the log file
$filePath = Join-Path -Path $env:LOCALAPPDATA -ChildPath "EpicGamesLauncher\Saved\Logs\EpicGamesLauncher.log"
$lastProcessedLine = ""
$initialLoad = $true
$continueMonitoring = $true

function CheckForKeyPress {
    if ($Host.UI.RawUI.KeyAvailable) {
        $key = $Host.UI.RawUI.ReadKey("NoEcho,IncludeKeyDown")
        return $false  # Stop monitoring when a key is pressed
    }
    return $true
}

try {
    while ($continueMonitoring) {
        Start-Sleep -Seconds 5

        if (-not (CheckForKeyPress)) {
            Write-Host "Key pressed, stopping monitoring..."
            break
        }

        $fileContent = Get-Content $filePath -ErrorAction SilentlyContinue
        $startIndex = 0

        if ($lastProcessedLine -ne "" -and $fileContent) {
            $startIndex = [array]::IndexOf($fileContent, $lastProcessedLine) + 1
        } elseif ($fileContent) {
            $lastProcessedLine = $fileContent[-1]
            $initialLoad = $false
            Write-Host "Initial setup complete. Monitoring for new game invites."
            continue
        }

        for ($i = $startIndex; $i -lt $fileContent.Count; $i++) {
            $line = $fileContent[$i]
            if ($line -match "LogWebView: \[Perf\] GameInviteReceived-") {
                $timestamp = Get-Date -Format "yyyy-MM-dd HH:mm:ss"
                Write-Host "Game invite received at $timestamp with details: $line"
                if (-not $initialLoad) {
                    Play-Sound -path $soundPath
                }
            }
            $lastProcessedLine = $line
        }
    }
} finally {
    Remove-Item -Path $soundPath -ErrorAction SilentlyContinue
    Write-Host "Temporary files cleaned up. Exiting script."
}